function Teste() {
	return (

	 <div className="bg-gray-100 py-3 ">
		 <div className="flex items-center justify-center flex-wrap mx-auto">
			 <div className="container">
				 
				 <h1 class="text-slate-900 font-extrabold text-4xl sm:text-5xl lg:text-6xl tracking-tight text-center ">Rapidly build modern websites without ever leaving your HTML.</h1>			 </div>
		 </div>
	 </div>
				 )
}

export default Teste;
